import React, { useState } from "react";

const Index = () => {
  const data = {
    name: "",
    email: "",
    pass: "",
  };
  const [user, setUser] = useState(data);
  return (
    <form>
      <input
        type="text"
        placeholder="Enter name"
        value={user.name}
        onChange={(e) =>
          setUser({
            ...user,
            name: e.target.value,
          })
        }
      />
      <br />
      <input
        type="text"
        placeholder="enter email"
        value={user.email}
        onChange={(e) =>
          setUser({
            ...user,
            email: e.target.value,
          })
        }
      />
    </form>
  );
};

export default Index;
